sys_variable_value.value:
(function execute(inputs, outputs) {
	if (inputs.status_code == "201") {
		outputs.status = "Success";
		var response = JSON.parse(inputs.response);
		outputs.lead_id = response.leadid;
	} else {
		outputs.status = "Error";
		outputs = new MicrosoftDynamicsCRMErrorHandler()
			.createLeadErrorHandler(inputs, outputs);
	}
})(inputs, outputs);

