sys_variable_value.value:
(function execute(inputs, outputs) {
	inputs = new MicrosoftDynamicsCRMUtils().trimStringInputs(inputs);
	var reqJson = {};
	reqJson["subject"] = inputs.topic ? inputs.topic : undefined;
	reqJson["firstname"] = inputs.first_name ? inputs.first_name :
	undefined;
	reqJson["lastname"] = inputs.last_name ? inputs.last_name : undefined;
	if (inputs.contact)
		reqJson["customerid_contact@odata.bind"] = "/contacts(" + inputs
		.contact + ")"
	reqJson["emailaddress1"] = inputs.email_address ? inputs.email_address :
		undefined;
	reqJson["msdyn_ordertype"] = inputs.order_type ? inputs.order_type :
		undefined;
	reqJson["industrycode"] = inputs.industry ? inputs.industry : undefined;
	if (inputs.currency)
		reqJson["transactioncurrencyid@odata.bind"] =
		"/transactioncurrencies(" + inputs.currency + ")";
	if (inputs.campaign)
		reqJson["campaignid@odata.bind"] = "/campaigns(" + inputs.campaign +
		")";
	if (inputs.additional_fields) {
		try {
			var FieldsArr = inputs.additional_fields.trim().split(/\^/);
			for (var i = 0; i < FieldsArr.length; i++) {
				var nameValuePair = FieldsArr[i].split(/=(.+)/);
				var keyValueJson = new MicrosoftDynamicsCRMUtils().getValue(
					nameValuePair[0], nameValuePair[1]);
				reqJson[keyValueJson.key] = keyValueJson.value;
			}
		} catch (e) {}
	}
	outputs.reqbody = JSON.stringify(reqJson);

})(inputs, outputs);

